import React from 'react'
import ReactDOM from 'react-dom'


class ContactForm extends React.Component {
    constructor(){
        super()
        this.state = {
            name:'',
            email:'',
            phone:'',
            message:''
        }
    }
  render () {
    return <div className='message-box'>
      
    </div>
  }
}

export default ContactForm
